Message:
Como funcionará na prática a fase inicial do processo de repactuação das dívidas pela *Lei do Superendividamento*, segundo o advogado Orlando Anzoategui Jr: 

1. O consumidor ingressará com medida extrajudicial ou judicial por meio de ação de repactuação contratual e de dívidas, requerendo - de plano audiência de conciliação, com a participação de todos os credores e bancos;
2. Muito importante instruir a ação com um bem fundamentado plano de pagamento e de restruturação das dívidas, unificando todas  e nominando os seus respectivos credores, facilitando assim  o momento e o eventual êxito da conciliação e provas;
3. Ocorrendo a composição pelas partes na audiência à reestruturação das dívidas, o juiz homologará o acordo, suspendendo todas as execuções e o nome dos cadastros de inadimplentes, até o final dos pagamentos acordados.
4. Se não ocorrer o acordo nesta conciliação, o processo avança de fase e à formação de sentença.

Não se enquadram na Lei do Superendividamento:
- financiamento imobiliário; 
- financiamento de veículos; 
- dívida rural;
- dívidas fiscais.

